import React from 'react'

class Sidebutton extends React.Component{
    render(){
        return (
            <><div name="button1">
                <button variant="text">{this.props.button_text1}</button>
            </div><div name="button2">
                <button variant="text">{this.props.button_text2}</button>
            </div><div name="button3">
                <button variant="text">{this.props.button_text3}</button>
            </div></>
        )
    }
}

export default Sidebutton
